import logo from './logo.svg';
import './App.css';
import Nav from "./Navbar";
import Storis from "./Stories";
import Create from "./Create";
import Post from "./Post";
import NavL from "./NavL";
function App() {
  return (
    <div className="App">
    <Nav />
    <Storis />
    <Create />
    <Post />
    <NavL />
    </div>
  );
}

export default App;
